svg.script:
function resetColor(){
setColore1('white');
setColore2('white');
setColore3('white');
setColore4('white');
var dirlinedir0 = document.getElementById('dirline.dir.0'); dirlinedir0.setAttribute('stroke','none');
var dirlinedir1 = document.getElementById('dirline.dir.1'); dirlinedir1.setAttribute('stroke','none');
var dirlinedir2 = document.getElementById('dirline.dir.2'); dirlinedir2.setAttribute('stroke','none');
var dirlinedir3 = document.getElementById('dirline.dir.3'); dirlinedir3.setAttribute('stroke','none');
var stopLinee10 = document.getElementById('stopLine.e10'); stopLinee10.setAttribute('visibility','hidden');
var stopLinee21 = document.getElementById('stopLine.e21'); stopLinee21.setAttribute('visibility','hidden');
var stopLinee32 = document.getElementById('stopLine.e32'); stopLinee32.setAttribute('visibility','hidden');
var stopLinee43 = document.getElementById('stopLine.e43'); stopLinee43.setAttribute('visibility','hidden');
};
function setColore1(color){
var TLR338tl12 = document.getElementById('TLR338.tl1.2'); TLR338tl12.setAttribute('fill',color);
var TLR912tl12 = document.getElementById('TLR912.tl1.2'); TLR912tl12.setAttribute('fill',color);
if(color == '#008000'){
var dirlinedir0 = document.getElementById('dirline.dir.0'); dirlinedir0.setAttribute('stroke',color);
}
if(color == '#ff0000'){
var stopLinee10 = document.getElementById('stopLine.e10'); stopLinee10.setAttribute('visibility','visible');
}
};
function setColore2(color){
var TLR912tl11 = document.getElementById('TLR912.tl1.1'); TLR912tl11.setAttribute('fill',color);
var TLR338tl11 = document.getElementById('TLR338.tl1.1'); TLR338tl11.setAttribute('fill',color);
var TLR338tl11 = document.getElementById('TLR338.tl1.1'); TLR338tl11.setAttribute('fill',color);
if(color == '#008000'){
var dirlinedir1 = document.getElementById('dirline.dir.1'); dirlinedir1.setAttribute('stroke',color);
}
if(color == '#ff0000'){
var stopLinee21 = document.getElementById('stopLine.e21'); stopLinee21.setAttribute('visibility','visible');
}
};
function setColore3(color){
var TLR912tl03 = document.getElementById('TLR912.tl0.3'); TLR912tl03.setAttribute('fill',color);
var TLR338tl03 = document.getElementById('TLR338.tl0.3'); TLR338tl03.setAttribute('fill',color);
if(color == '#008000'){
var dirlinedir2 = document.getElementById('dirline.dir.2'); dirlinedir2.setAttribute('stroke',color);
}
if(color == '#ff0000'){
var stopLinee32 = document.getElementById('stopLine.e32'); stopLinee32.setAttribute('visibility','visible');
}
};
function setColore4(color){
var TLR497tl01 = document.getElementById('TLR497.tl0.1'); TLR497tl01.setAttribute('fill',color);
var TLR585tl01 = document.getElementById('TLR585.tl0.1'); TLR585tl01.setAttribute('fill',color);
if(color == '#008000'){
var dirlinedir3 = document.getElementById('dirline.dir.3'); dirlinedir3.setAttribute('stroke',color);
}
if(color == '#ff0000'){
var stopLinee43 = document.getElementById('stopLine.e43'); stopLinee43.setAttribute('visibility','visible');
}
};
window.onload = function(){resetColor();}
function setPhase(phase){
resetColor();
if (phase == 1){
setColore1('#008000');
setColore2('#ff0000');
setColore3('#ff0000');
setColore4('#ff0000');
}
if (phase == 2){
setColore1('#ffff00');
setColore2('#ffff00');
setColore3('#ffff00');
setColore4('#ffff00');
}
if (phase == 3){
setColore1('#ff0000');
setColore2('#008000');
setColore3('#ff0000');
setColore4('#ff0000');
}
if (phase == 7){
setColore1('#ff0000');
setColore2('#ff0000');
setColore3('#008000');
setColore4('#ff0000');
}
if (phase == 9){
setColore1('#ff0000');
setColore2('#ff0000');
setColore3('#ff0000');
setColore4('#008000');
}
};
function getPhasesMass(){
var mass = [{phase:'',num:'1'},
{phase:'',num:'2'},
{phase:'',num:'3'},
{phase:'',num:'7'},
{phase:'',num:'9'}];
return mass;};
